import React from 'react'
import Button from 'react-bootstrap/Button';

function Home() {
    return (
        <div class="reports">
            <button>HTTP</button>
            <button>FTP</button>
            <button>SMTP</button>
            <button>SSH</button>
        </div>
    );
}

export default Home;
